import { Wrapper } from './styled';
import React from 'react'

function App():JSX.Element {
  return (
    <div className="App">
      <Style.Wrapper>
      <section className="App-header">
        <input type="text"/>
        <input type="button" value="submit"/>
      </section>
      </Style.Wrapper>
    </div>
  );
}

export default App;
